INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (4.74, 7, 2, 12300147, "vo_minigame_1012_result_1079", 1, 5, 0, 9, 1, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.0, 1, 2, 12300148, "vo_minigame_1012_result_1080", 1, 5, 0, 9, 1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.21, 8, 2, 12300149, "vo_minigame_1012_result_1081", 1, 5, 0, 9, 2, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.46, 3, 2, 12300150, "vo_minigame_1012_result_1082", 1, 5, 0, 9, 2, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.94, 3, 2, 12300151, "vo_minigame_1012_result_1083", 1, 5, 0, 9, 2, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (4.19, 7, 2, 12300152, "vo_minigame_1012_result_1084", 1, 5, 0, 9, 3, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.0, 1, 2, 12300153, "vo_minigame_1012_result_1085", 1, 5, 0, 9, 3, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.63, 3, 2, 12300154, "vo_minigame_1012_result_1086", 1, 5, 0, 9, 3, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (5.53, 3, 2, 12300155, "vo_minigame_1012_result_1087", 1, 1, 0, 4, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.01, 3, 2, 12300156, "vo_minigame_1012_result_1088", 1, 1, 9, 4, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 3, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (4.15, 3, 2, 12300157, "vo_minigame_1012_result_1089", 1, 1, 3, 4, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.01, 9, 2, 12300158, "vo_minigame_1012_result_1090", 1, 1, 9, 4, 2, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 9, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (5.37, 3, 2, 12300159, "vo_minigame_1012_result_1091", 1, 1, 0, 4, 2, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (1.44, 3, 2, 12300160, "vo_minigame_1012_result_1092", 1, 1, 0, 4, 2, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.0, 3, 2, 12300161, "vo_minigame_1012_result_1093", 1, 1, 0, 4, 3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.91, 3, 2, 12300162, "vo_minigame_1012_result_1094", 1, 1, 3, 4, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 9, 3001);
