INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.01, 4, 2, 22300156, "vo_minigame_1012_result_2088", 2, 1, 6, 4, 1, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 4, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (5.28, 0, 2, 22300157, "vo_minigame_1012_result_2089", 2, 1, 0, 4, 1, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 3, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.89, 0, 2, 22300158, "vo_minigame_1012_result_2090", 2, 1, 0, 4, 2, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 3, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (5.45, 0, 2, 22300159, "vo_minigame_1012_result_2091", 2, 1, 0, 4, 2, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 7, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (4.29, 4, 2, 22300160, "vo_minigame_1012_result_2092", 2, 1, 3, 4, 2, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 10, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (4.64, 4, 2, 22300161, "vo_minigame_1012_result_2093", 2, 1, 6, 4, 3, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 8, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (3.14, 9, 2, 22300162, "vo_minigame_1012_result_2094", 2, 1, 0, 4, 3, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 5, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (6.59, 7, 2, 22300163, "vo_minigame_1012_result_2095", 2, 1, 0, 4, 3, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 4, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.0, 3, 2, 22300164, "vo_minigame_1012_result_2096", 2, 0, 0, 0, 1, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 3, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.2, 9, 2, 22300165, "vo_minigame_1012_result_2097", 2, 0, 5, 0, 1, "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 10, 3001);
INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (0.01, 4, 2, 22300166, "vo_minigame_1012_result_2098", 2, 0, 6, 0, 1, "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 4, 3001);
