INSERT INTO `v1_1971d7b64c845da7646e9fcf928706a03b25dff0b10f76e7b0fffab24dc9532a` VALUES (2.1, 4, 2, 22300169, "vo_minigame_1012_result_2101", 2, 0, 11, 0, 2, "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 0, 3001);
